def add_default_images(apps, schema_editor):
    ForumImage = apps.get_model("notifications", "ForumImage")

    for color_id, url in COLOR_URLS.items():
        ForumImage.objects.filter(lookup_id=str(color_id)).update(url=url)

    for world_type, urls in WORLD_TYPES.items():
        ForumImage.objects.create(
            image_type=2, lookup_id=world_type, shortcut_url=urls[0], url=urls[1]
        )

    for atmosphere, urls in ATMOSPHERES.items():
        ForumImage.objects.create(
            image_type=3, lookup_id=atmosphere, shortcut_url=urls[0], url=urls[1]
        )

    for lookup, urls in MISC.items():
        ForumImage.objects.create(
            image_type=4, lookup_id=lookup, shortcut_url=urls[0], url=urls[1]
        )


